import styled from "styled-components";
export {};
export const StyledLogo = styled.section`
  width: 20%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  div {
    display: flex;
    height: 60px;
    width: 60px;
    border-radius: 5px;
    background-color: #27ae601a;

    img {
      height: 20px;
      width: 18px;
    }
  }
`;
